 @galdino3635  Apontou errado, a pergunta dela foi retórica por ser um lance imediato e ao vivo. Mas pra vc deve ser fácil né.  Dicção deve ser incrível, pensamento espontâneo e tático, argumentação esportiva e vocal e mil equipamentos calibrados. Se vc for um especialista  e melhor que ela, é um crítico bizarro, agora se vc n for porra nenhuma e só sabe vim aqui digitar asneira e apontar o dedo é vergonhoso e lamentável! MELHORE ! 


OBS: O LANCE NÃO FOI PÊNALTI O JUIZ, HUMANA E FALHO APONTOU PRA MARCA PENAL EQUIVOCADAMENTE E EM SEGUIDA FOI CORRIGIDO PELO VAR. A MOÇA NA DÚVIDA E CERTA FEZ A PERGUNTA. 


SE ATENTE E QUANDO FOR FAZER UMA CRÍTICA QUE JÁ RUIM, PELO MENOS TENHA EMBASAMENTO PRA N FICAR FEIO.

